<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Video Playlist</title>
    <script src="https://cdn.tailwindcss.com"></script>
    <style>
        .video-container { position: relative; padding-bottom: 56.25%; height: 0; overflow: hidden; }
        .video-container video { position: absolute; top: 0; left: 0; width: 100%; height: 100%; object-fit: contain; }
        video:fullscreen, video:-webkit-full-screen { width: 100vw; height: 100vh; object-fit: contain; background: black; }
        @media (max-width: 1023px) { video:fullscreen + .custom-controls, video:-webkit-full-screen + .custom-controls { display: none; } }
        #playlist { max-height: calc(100vh - 80px); overflow-y: auto; scrollbar-width: thin; scrollbar-color: #ffffff #1f2937; }
        #playlist::-webkit-scrollbar { width: 8px; }
        #playlist::-webkit-scrollbar-track { background: #1f2937; }
        #playlist::-webkit-scrollbar-thumb { background: #ffffff; border-radius: 4px; }
        #playlist::-webkit-scrollbar-thumb:hover { background: #e5e7eb; }
    </style>
</head>
<body class="bg-black text-white font-sans">
    <div class="flex h-screen">
        <div id="sidebar" class="w-64 bg-gray-900 shadow-lg lg:w-80 fixed inset-y-0 left-0 transform lg:transform-none transition-transform duration-300 ease-in-out -translate-x-full lg:translate-x-0 z-20">
            <div class="p-4">
                <h2 class="text-xl font-bold mb-4 text-white">Video Playlist</h2>
                <ul id="playlist" class="space-y-2"></ul>
            </div>
        </div>

        <div id="mainContent" class="flex-1 p-4 lg:ml-80 transition-all duration-300">
            <button id="toggleSidebar" class="fixed top-4 left-4 w-12 h-12 bg-white hover:bg-gray-200 text-black rounded-full flex items-center justify-center lg:hidden z-30 transition-all duration-300 shadow-lg">
                <svg id="toggleIcon" class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                    <path id="togglePath" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M9 5l7 7-7 7"></path>
                </svg>
            </button>

            <div class="flex flex-col items-center max-w-4xl mx-auto pt-16">
                <div class="flex items-center w-full">
                    <button id="prevVideo" class="p-2 bg-white text-black rounded-l disabled:opacity-50 hover:bg-gray-200" disabled>
                        <svg class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15 19l-7-7 7-7"></path>
                        </svg>
                    </button>

                    <div id="videoPlayer" class="video-container flex-1"></div>

                    <button id="nextVideo" class="p-2 bg-white text-black rounded-r disabled:opacity-50 hover:bg-gray-200">
                        <svg class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M9 5l7 7-7 7"></path>
                        </svg>
                    </button>
                </div>

                <div class="custom-controls flex items-center mt-4 space-x-4">
                    <button id="playPauseButton" class="p-2 bg-white text-black rounded-full w-12 h-12 flex items-center justify-center hover:bg-gray-200">
                        <svg id="playPauseIcon" class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M10 9v6l5-3-5-3zm4 0v6l5-3-5-3z"></path>
                        </svg>
                    </button>

                    <div class="flex items-center space-x-2">
                        <svg class="w-5 h-5 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M15.536 8.464a5 5 0 010 7.072m-4.243-7.071a5 5 0 000 7.071M12 4v16"></path>
                        </svg>
                        <input id="volumeSlider" type="range" min="0" max="1" step="0.01" value="1" class="w-32 accent-white">
                    </div>

                    <button id="modeButton" class="p-2 bg-white text-black rounded-full w-12 h-12 flex items-center justify-center hover:bg-gray-200">
                        <span id="modeLabel" class="text-sm font-bold">Loop</span>
                    </button>

                    <button id="fullscreenButton" class="p-2 bg-white text-black rounded-full w-12 h-12 flex items-center justify-center hover:bg-gray-200">
                        <svg id="fullscreenIcon" class="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                            <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M8 3H5a2 2 0 00-2 2v3m18 0V5a2 2 0 00-2-2h-3m0 18h3a2 2 0 002-2v-3M3 16v3a2 2 0 002 2h3"></path>
                        </svg>
                    </button>
                </div>
            </div>
        </div>
    </div>

        `;
        const videoUrls = videoUrlsString.split('\n').map(u => u.trim()).filter(u => u);

        const playlist = document.getElementById('playlist');
        const videoPlayer = document.getElementById('videoPlayer');
        const volumeSlider = document.getElementById('volumeSlider');
        const prevVideo = document.getElementById('prevVideo');
        const nextVideo = document.getElementById('nextVideo');
        const playPauseButton = document.getElementById('playPauseButton');
        const playPauseIcon = document.getElementById('playPauseIcon');
        const fullscreenButton = document.getElementById('fullscreenButton');
        const modeButton = document.getElementById('modeButton');
        const modeLabel = document.getElementById('modeLabel');

        let currentVideoIndex = 0;
        let isLoopMode = true;

        function createVideoPlayer(url) {
            videoPlayer.innerHTML = `
                <video id="currentVideo" controls autoplay ${isLoopMode ? 'loop' : ''} playsinline class="w-full h-full">
                    <source src="${url}" type="video/mp4">
                </video>
            `;
            const video = document.getElementById('currentVideo');
            video.volume = volumeSlider.value;
            updatePlayPauseIcon(video.paused);
            video.addEventListener('play', () => updatePlayPauseIcon(false));
            video.addEventListener('pause', () => updatePlayPauseIcon(true));
            if (!isLoopMode) {
                video.addEventListener('ended', () => {
                    if (currentVideoIndex < videoUrls.length - 1) updateHash(currentVideoIndex + 1);
                });
            }
        }

        function updatePlayPauseIcon(isPaused) {
            playPauseIcon.innerHTML = isPaused
                ? `<path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M10 9v6l5-3-5-3zm4 0v6l5-3-5-3z"></path>`
                : `<path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M6 4h4v16H6zm8 0h4v16h-4z"></path>`;
        }

        function populatePlaylist() {
            playlist.innerHTML = '';
            videoUrls.forEach((url, i) => {
                const li = document.createElement('li');
                li.className = `p-2 hover:bg-gray-800 cursor-pointer ${i === currentVideoIndex ? 'bg-gray-800' : ''}`;
                li.textContent = `#${i + 1} Video`;
                li.addEventListener('click', () => updateHash(i));
                playlist.appendChild(li);
            });
        }

        function updateHash(index) {
            location.hash = `#${index + 1}`;
        }

        function loadFromHash() {
            const num = parseInt(location.hash.replace('#', ''));
            if (!isNaN(num) && num > 0 && num <= videoUrls.length) currentVideoIndex = num - 1;
            else currentVideoIndex = 0;
            createVideoPlayer(videoUrls[currentVideoIndex]);
            populatePlaylist();
            updateNavButtons();
        }

        function updateNavButtons() {
            prevVideo.disabled = currentVideoIndex === 0;
            nextVideo.disabled = currentVideoIndex === videoUrls.length - 1;
        }

        prevVideo.addEventListener('click', () => { if (currentVideoIndex > 0) updateHash(currentVideoIndex - 1); });
        nextVideo.addEventListener('click', () => { if (currentVideoIndex < videoUrls.length - 1) updateHash(currentVideoIndex + 1); });

        playPauseButton.addEventListener('click', togglePlayPause);
        volumeSlider.addEventListener('input', () => { const v = document.getElementById('currentVideo'); if (v) v.volume = volumeSlider.value; });
        fullscreenButton.addEventListener('click', () => { const v = document.getElementById('currentVideo'); if (document.fullscreenElement) document.exitFullscreen(); else v.requestFullscreen(); });
        modeButton.addEventListener('click', () => { isLoopMode = !isLoopMode; modeLabel.textContent = isLoopMode ? 'Loop' : 'Auto'; const v = document.getElementById('currentVideo'); if (v) v.loop = isLoopMode; });

        function togglePlayPause() {
            const v = document.getElementById('currentVideo');
            if (v) { if (v.paused) v.play(); else v.pause(); updatePlayPauseIcon(v.paused); }
        }

        // --- Keyboard Controls (Desktop only) ---
        document.addEventListener('keydown', (e) => {
            if (window.innerWidth < 1024) return; // desktop only
            const v = document.getElementById('currentVideo');
            if (!v) return;

            switch (e.key.toLowerCase()) {
                case ' ':
                case 'k':
                    e.preventDefault();
                    togglePlayPause();
                    break;
                case 'arrowleft':
                    if (currentVideoIndex > 0) updateHash(currentVideoIndex - 1);
                    break;
                case 'arrowright':
                    if (currentVideoIndex < videoUrls.length - 1) updateHash(currentVideoIndex + 1);
                    break;
                case 'arrowup':
                    e.preventDefault();
                    v.volume = Math.min(1, v.volume + 0.05);
                    volumeSlider.value = v.volume;
                    break;
                case 'arrowdown':
                    e.preventDefault();
                    v.volume = Math.max(0, v.volume - 0.05);
                    volumeSlider.value = v.volume;
                    break;
                case 'm':
                    isLoopMode = !isLoopMode;
                    modeLabel.textContent = isLoopMode ? 'Loop' : 'Auto';
                    v.loop = isLoopMode;
                    break;
            }
        });

        window.addEventListener('hashchange', loadFromHash);
        loadFromHash();
    </script>
